import { StatusBar } from 'expo-status-bar';
import { StyleSheet, Text, View, Image, ImageBackground } from 'react-native';
import Icon from './Icon'
import { useFonts } from 'expo-font'

export default function App() {
  const [fontsLoaded] = useFonts({
    'Allison': require('./assets/fonts/Allison.ttf'),
  })
  const styles = StyleSheet.create({
    container: {
      flex: 1,
    },
    image: {
      flex: 1,
      justifyContent: 'center',
      resizeMode: "cover",
    },
    text: {
      color: 'white', 
      fontFamily: 'Allison', 
      fontSize: 80, 
      zIndex: 3, 
      elevation: 3, 
      textAlign: 'center', 
      
    },
  })
  

  return (
    <View style={styles.container}>
      <StatusBar style="auto" />
      {/* <Image source={Icon.logo} style={{width: 100, height: 100}} /> */}
      <ImageBackground source="https://14thlane.ro/files/pages/1/OurStory2.webp" resizeMode="cover" style={styles.image}>
        <Text style={styles.text}>FoodFinder</Text>
      </ImageBackground>

    </View>
    
  );
}
